import { PropertyService } from './../../shared/services/property.service';
import { Component } from '@angular/core';
import { AuthService } from './../../shared/services/auth.service';
import { Router } from '@angular/router';
import { property } from 'src/app/shared/models/property';

@Component({
  selector: 'app-your-listing',
  templateUrl: './your-listing.component.html',
  styles: [],
})
export class YourListingComponent {

  public properties :Array<property> = [];

  constructor(private router: Router,private private authService: AuthService,private propertyService: PropertyService) {}
  ngOnInit(): void {
    if (!this.authService.isLogedin) {
      this.router.navigate(['/signin']);
    }
  }

  getPropertiesByEmail(){
    this.propertyService.getPropertiesByEmail('playatanu@gmail.com').subscribe({
      next: (res :Array<property>) => {
        this.properties = res; 
      },
      error: (error:any) => {
        this.errorService.handelError(error);
      },
    });
  }
}
